import React, {Component} from 'react';
import {Link} from 'react-router-dom';

import '../main.css';

function Header() {

  return (
    <div className="App">
      <div className="main-title" ><Link to="/">DoTory</Link></div>
      <div>
          <img className="logo" alt="dotory" src='../dotory.jpeg'/>
      </div>

      <nav>
        <ul className="nav-container">

          <li className = "nav-item"><Link to="/">Checklist</Link></li>
          <li className = "nav-item"><Link to="/">Diary</Link></li>
          <li className = "nav-item"><Link to="/pocket-page">Pocket</Link></li>        

        </ul>
      </nav>

    </div>
  );
}

export default Header;
